(function(){if(!Element.prototype.matches){Element.prototype.matches=Element.prototype.matchesSelector||Element.prototype.webkitMatchesSelector||Element.prototype.mozMatchesSelector||Element.prototype.msMatchesSelector}if(!Element.prototype.closest){Element.prototype.closest=function(a){var b=this;while(b){if(b.matches(a)){return b}else{b=b.parentElement}}return null}}})();